  <script>
    function parse_ticker(text_, adef) {
      text__ = text_.split(';')
      text = text__[0]
      dir = ""
      level = ""
      if (text__.length > 1) {
        dir = text__[1].substring(0, 1)
        level = text__[1].substring(1)
      }
      if (text.length < 7) {
        return [text, adef, dir, level]
      }
      dt = text.substring(0, 6)
      ticker = text.substring(6)
      dt_ = parseInt(dt)
      if (dt_.toString() == dt) {
        dt = "20" + dt[0] + dt[1] + '-' + dt[2] + dt[3] + '-' + dt[4] + dt[5]
        return [ticker, dt, dir, level]
      }
      return [text, adef, dir, level]
    }

    function _base64ToArrayBuffer(base64) {
      var binary_string = window.atob(base64);
      var len = binary_string.length;
      var bytes = new Uint8Array(len);
      for (var i = 0; i < len; i++) {
        bytes[i] = binary_string.charCodeAt(i);
      }
      return bytes;
    };

    const decodeSignedLeb128 = (input) => {
      let result = 0;
      let shift = 0;
      while (true) {
        const byte = input.shift();
        result |= (byte & 0x7f) << shift;
        shift += 7;
        if ((0x80 & byte) === 0) {
          if (shift < 32 && (byte & 0x40) !== 0) {
            return result | (~0 << shift);
          }
          return result;
        }
      }
    };

    function uint8ArrayToArray(uint8Array) {
      var array = [];

      for (var i = 0; i < uint8Array.byteLength; i++) {
        array[i] = uint8Array[i];
      }

      return array;
    }

    const fmtDate = (d) => { return ("0" + d.getDate()).slice(-2) + "-" + ("0" + (d.getMonth() + 1)).slice(-2) + "-" + d.getFullYear(); }

    const decodeSignedLeb128_all = (input_, end_ = '2022-05-06', mode = "bar") => {
      end__ = Date.parse(end_ + ' 00:00:00 GMT');
      // console.log(end)
      input = uint8ArrayToArray(_base64ToArrayBuffer(input_))
      var ans = [];
      // console.log(input);
      while (input.length > 0) {
        ans = ans.concat([decodeSignedLeb128(input)]);
      }
      var len = ans[0];
      var d = new Date(ans[1] * 1000);
      var start = fmtDate(d);
      var d = new Date(ans[2] * 1000);
      var end = fmtDate(d);

      var ohlc = { 'len': len, 'start_': ans[1], 'start': start, 'end_': ans[2], 'end': end, 'data': [] };
      if (((ans.length - 3) % len) == 0) {
        var count = (ans.length - 3) / len;
        var last = [0, 0, 0, 0, 0];
        for (var i = 0; i < count; i++) {
          if (i == 0) {
            last = [ans[i * len + 3] * 1000, ans[i * len + 4], ans[i * len + 5], ans[i * len + 6], ans[i * len + 7]];
            var d = new Date(last[0]);
            var datestring = fmtDate(d);
            //ohlc.data.push([last[0], (last[1] * 0.01).toFixed(2), (last[2] * 0.01).toFixed(2), (last[3] * 0.01).toFixed(2), (last[4] * 0.01).toFixed(2), datestring]);
            ohlc.data.push([last[0], last[1] * 0.01, last[2] * 0.01, last[3] * 0.01, last[4] * 0.01]);
          } else {
            last[0] += ans[i * len + 3] * 1000
            last[1] += ans[i * len + 4]
            last[2] += ans[i * len + 5]
            last[3] += ans[i * len + 6]
            last[4] += ans[i * len + 7]
            var d = new Date(last[0]);
            var datestring = fmtDate(d);
            //ohlc.data.push([last[0], (last[1] * 0.01).toFixed(2), (last[2] * 0.01).toFixed(2), (last[3] * 0.01).toFixed(2), (last[4] * 0.01).toFixed(2), datestring]);
            ohlc.data.push([last[0], last[1] * 0.01, last[2] * 0.01, last[3] * 0.01, last[4] * 0.01]);
          }
          if (ohlc.data.length > 250) {
            ohlc.data = ohlc.data.slice(-250);
          }
          if ((last[0] * 1) >= end__) {
            if (mode == "renko") {
              temp = []
              step = Math.trunc((ohlc.data[ohlc.data.length - 1][2] - ohlc.data[ohlc.data.length - 1][3]))
              if (step < 1)
                step = 1.0
              console.log(step)
              start = Math.trunc(ohlc.data[0][1] / step) * step
              idf = 1
              for (var i = 0; i < ohlc.data.length; i++) {
                for (var j = 1; j < 5; j++) {
                  delta = ohlc.data[i][j] - start
                  cnt = Math.trunc(delta / step)
                  if (cnt >= 1) {
                    for (var m = 0; m < cnt; m++) {
                      temp.push([idf, start, start + step, start, start + step])
                      idf++
                      start += step
                    }
                  }
                  if (cnt <= -1) {
                    cnt = Math.abs(cnt)
                    for (var m = 0; m < cnt; m++) {
                      temp.push([idf, start, start, start - step, start - step])
                      idf++
                      start -= step
                    }
                  }
                  //console.log(ohlc.data[i][j], start, delta, cnt)
                }

                // temp.push([i * 4 + 1, ohlc.data[i][1], ohlc.data[i][1], ohlc.data[i][1], ohlc.data[i][1]])
                // temp.push([i * 4 + 2, ohlc.data[i][2], ohlc.data[i][2], ohlc.data[i][2], ohlc.data[i][2]])
                // temp.push([i * 4 + 3, ohlc.data[i][3], ohlc.data[i][3], ohlc.data[i][3], ohlc.data[i][3]])
                // temp.push([i * 4 + 4, ohlc.data[i][4], ohlc.data[i][4], ohlc.data[i][4], ohlc.data[i][4]])
              }
              ohlc.data = temp
            }
            break;
          }
        }
      } else {
        console.log("error size");
      };
      return ohlc;
    };

              this.current_test.desc1 = ""
              this.current_test.desc2 = ""
              this.current_test.desc3 = ""
            }
            color = "yellow"
            if (this.current_test.dir == "D") {
              color = "red"
            }
            if (this.current_test.dir == "U") {
              color = "green"
            }
            if (this.current_test.level != '') {
              this.mydata.onchart =
                [{
                  "name": "Level", "type": "Segment", "data": [], "settings": {
                    "p1": [this.mydata.ohlcv[0][0], parseFloat(this.current_test.level)],
                    "p2": [this.mydata.ohlcv[this.mydata.ohlcv.length - 1][0], parseFloat(this.current_test.level)],
                    "lineWidth": 1, "color": color, "legend": false
                  }
                }]
            } else {
              this.mydata.onchart = []
            }
            atrs = []
            sums = []
            for (var i = 0; i < this.mydata.ohlcv.length; i++) {
              atr = this.mydata.ohlcv[i][2] - this.mydata.ohlcv[i][3]
              sums.push(atr)
              sums = sums.slice(-14)
              atr_ = 0
              if (sums.length > 0) {
                const sum = sums.reduce((partialSum, a) => partialSum + a, 0);
                atr_ = sum / sums.length
              }
              atrs.push([this.mydata.ohlcv[i][0], atr_, atr])

            }
            this.mydata.offchart[0].data = atrs
            //this.goto(this.mydata.ohlcv[this.mydata.ohlcv.length - 1][0])
            //this.$refs.chart.goto(1592391600000)
            //this.$refs.tradingVue.resetChart()
            temp = this.current_test.name
            this.current_test.name = ""
            this.current_test.name = temp
            this.current_test.icon = ""
          } else {
            //  this.mydata.ohlcv = []
            this.current_test.icon = "⚠️"
            this.current_test.name = ""

          }

        },
        prev_test() {
          let list = Object.values(TESTS__[this.items_pos])

          if (--this.test_index < 0) {
            this.test_index = list.length - 1
          }
          // this.update_test("A", def_date)
          this.update_test(list[this.test_index].toString(), def_date)
        },
        next_test() {
          let list = Object.values(TESTS__[this.items_pos])

          if (++this.test_index >= list.length) {
            this.test_index = 0
          }
          this.update_test(list[this.test_index].toString(), def_date)
        },

        new_test() {
          this.items_pos += 1;
          if (this.items_pos >= this.items.length) {
            this.items_pos = 0
          }
          this.items_name = this.items[this.items_pos]
          this.len = Object.values(TESTS__[this.items_pos]).length,
            this.test_index = 0
          let list = Object.values(TESTS__[this.items_pos])
          this.update_test(list[this.test_index].toString(), def_date)
        }
      },
      computed: {
        colors() {
          return this.night ? {} : {
            colorBack: '#fff',
            colorGrid: '#eee',
            colorText: '#333'
          }
        },
      },
      watch: {
        test_index(v) {
          setTimeout(() => location.hash = `${v + 1}`)
        },
        night(v) {
          localStorage.setItem('tvjstest:nm', v)
        }
      },
      beforeDestroy() {
        window.removeEventListener('resize', this.onResize)
      },

    });
  </script>
